import Head from 'next/head';
import Navigation from './Navigation';
import DocumentLoaded from '../components/Document';

const Layout = (props) => (
  <div>
    <Head>
      <title>Next.js Proyect</title>
      <DocumentLoaded />
    </Head>
    <Navigation />
    <div>{props.children}</div>
  </div>
);

export default Layout;
